('Fancy Feast Grilled Seafood Feast Variety Pack Canned Cat Food', 'cat', 'wet food', 19.55, NULL, 'Fancy Feast', 1608, 4.6, 'https://image.chewy.com/is/image/catalog/76096_MAIN._AC_SL1200_V1683817847_.jpg', 'https://image.chewy.com/is/image/catalog/76096_PT1._AC_SL1200_V1683817357_.jpg', 'https://image.chewy.com/is/image/catalog/76096_PT5._AC_SL1200_V1683817421_.jpg', 'https://image.chewy.com/is/image/catalog/76096_PT8._AC_SL1200_V1683817420_.jpg', 'Made without artificial colors or preservatives.', 'Contains real, high-quality ingredients delivering 100% complete, balanced nutrition.', 'Developed in partnership with expert nutritionists as a high-protein gourmet wet food.', 'Offers a uniquely scrumptious taste experience for your feline friend.', 'Crafted with real seafood, tuna or salmon in a light, savory gravy and a blend of vitamins and minerals.'),
('Temptations MixUps Surfers'' Delight Flavor Soft & Crunchy Cat Treats', 'cat', 'crunchy treats', 8.48, 8.06, 'Temptations', 1740, 4.8, 'https://image.chewy.com/is/image/catalog/81309_MAIN._AC_SL1200_V1571277955_.jpg', 'https://image.chewy.com/is/image/catalog/81309_PT3._AC_SL1200_V1571277982_.jpg', 'https://image.chewy.com/is/image/catalog/81309_PT5._AC_SL1200_V1571278004_.jpg', 'https://image.chewy.com/is/image/catalog/81309_PT8._AC_SL1200_V1571278052_.jpg', '100% nutritionally and complete rewards for adult cats.', 'Each piece has under two calories per treat, so your cat can enjoy more, and you don''t have to feel guilty about giving her more!', 'Delivers a variety of textures with a crunchy outside and a soft and creamy inside.', 'Made with a unique pocket shape and a lip-smacking tuna, shrimp and salmon flavors that will have your pal purring for more.', 'Crafted with vitamins and taurine—an amino acid that helps support your cat''s overall health and well-being.'),
