('Inaba Churu Tuna & Chicken Puree Variety Pack Grain-Free Lickable Cat Treat', 'cat', 'soft treats', 31.34, 29.77, 'Inaba', 692, 4.8, 'https://image.chewy.com/is/image/catalog/157717_MAIN._AC_SL1200_V1635978788_.jpg', 'https://image.chewy.com/is/image/catalog/157717_PT1._AC_SL1200_V1635974821_.jpg', 'https://image.chewy.com/is/image/catalog/157717_PT2._AC_SL1200_V1635975724_.jpg', 'https://image.chewy.com/is/image/catalog/157717_PT5._AC_SL1200_V1635978155_.jpg', 'Every Inaba product is made with yummy, high-quality ingredients including farm-raised chicken and/or wild-caught tuna.', 'Each delicious, creamy Churu tube contains 91% moisture and only six calories, which makes it a healthy snack you can feel good about feeding.', 'Added ingredients like taurine help promote your kitty''s overall health.', 'These lickable purée meat tubes for cats were designed to be fed by hand as an interactive way to spend time with your feline, but you can also use them as a cat food topper or as a clever way to disguise medication.', 'Contains no grains, preservatives, artificial colors or carrageenan.'),
('Yeowww! Organic Catnip', 'cat', 'soft treats', 10.95, NULL, 'Yeowww!', 1435, 4.4, 'https://image.chewy.com/is/catalog/103031._AC_SL600_V1467808857_.jpg', NULL, NULL, NULL, '"100% organically grown, free from chemicals and pesticides', 'A high quality blend of leaf and flower tops for optimal potency', 'Sprinkle on toys and scratchers for even more fun', 'Add to food to entice the fussiest of felines', 'Comes in a resealable bag or tub for maximum freshness'),
('Frisco Butterfly Cat Tracks Cat Toy', 'cat', 'toys', 10.23, NULL, 'Frisco', 2980, 4.6, 'https://image.chewy.com/is/image/catalog/161805_MAIN._AC_SL1200_V1565736429_.jpg', 'https://image.chewy.com/is/image/catalog/161805_PT1._AC_SL1200_V1674080695_.jpg', 'https://image.chewy.com/is/image/catalog/161805_PT2._AC_SL1200_V1678723852_.jpg', 'https://image.chewy.com/is/image/catalog/161805_PT8._AC_SL1200_V1665517525_.jpg', 'From Frisco by Chewy. This interactive triple-tiered tower equips each level with its own colorful rolling ball to provide three stories of stimulating play.', 'Spinning action of the ball, rolling sound and bouncy butterfly on top keep cats engaged in play, helping them get the exercise and mental stimulation they need.', 'Nonskid pads keep the tracks from sliding so cats can play all they want.', 'Perfect for a single kitty or multiple cats, too. Includes a replacement butterfly piece to keep the excitement going.', 'Frisco products are crafted to deliver more happy moments together—from stimulating cat toys to adorable apparel, to sturdy cat trees. Designed, tested and approved by the pet experts at Chewy.'),
