('Frisco Foldable Play Tri-Tunnel Cat Toy, Colorful', 'cat', 'toys', 11.35, 10.78, 'Frisco', 750, 4.5, 'https://image.chewy.com/is/image/catalog/166382_MAIN._AC_SL1200_V1668737518_.jpg', 'https://image.chewy.com/is/image/catalog/166382_PT1._AC_SL1200_V1674080692_.jpg', 'https://image.chewy.com/is/image/catalog/166382_PT2._AC_SL1200_V1682976333_.jpg', 'https://image.chewy.com/is/image/catalog/166382_PT3._AC_SL1200_V1668737518_.jpg', 'From Frisco by Chewy. This pop-up cat play tunnel provides fun interactive games and an enticing hiding spot to keep your kitty stimulated.', 'Cats love to explore enclosed spaces like tunnels, so this toy is sure to spark your cat''s interest.', 'Easy to use—just pop it open and then easily fold it down for quick and simple storage.', 'Great for hide-and-seek, all-around exploring, and for catnaps whether there''s one cat or a whole kitty crew.', 'Frisco products are crafted to deliver more happy moments together—from stimulating cat toys to adorable apparel, to sturdy cat trees. Designed, tested and approved by the pet experts at Chewy.'),
('Meowfia Premium Felt Cat Cave Bed', 'cat', 'beds', 49.99, NULL, 'Meowfia', 441, 4.8, 'https://image.chewy.com/is/image/catalog/137344_MAIN._AC_SL1200_V1680881181_.jpg', 'https://image.chewy.com/is/image/catalog/137344_PT2._AC_SL1200_V1680895413_.jpg', 'https://image.chewy.com/is/image/catalog/137344_PT3._AC_SL1200_V1680895415_.jpg', 'https://image.chewy.com/is/image/catalog/137344_PT4._AC_SL1200_V1680895352_.jpg', 'Handcrafted from 100% New Zealand Merino wool by highly skilled artisans in Nepal; safe, eco-friendly process uses no chemicals or synthetics.', 'Made with a traditional wet-felting technique that transforms the wool yarn into a dense fabric that can stand up to kitty''s claws.', 'Soft, supple and breathable to help him stay cool in the summer and warm in the winter; medium size cave can accommodate cats up to 12 pounds and large can accommodate cats up to 20 pounds.', 'Each bed is hand-molded from a single piece of fabric with no seams or stitching to burst or fray.', 'Sleek, contemporary design is available in five color combinations to fit your cat''s unique personality and complement any décor.'),
('Best Friends by Sheri Cuddle Cup Cuddler Bolster Cat & Dog Bed', 'cat', 'beds', 24.95, NULL, 'Best Friends by Sheri', 92, 4, 'https://image.chewy.com/is/image/catalog/193279_MAIN._AC_SL1200_V1631679136_.jpg', 'https://image.chewy.com/is/image/catalog/193279_PT2._AC_SL1200_V1631687481_.jpg', 'https://image.chewy.com/is/image/catalog/193279_PT1._AC_SL1200_V1631689628_.jpg', 'https://image.chewy.com/is/image/catalog/193279_PT3._AC_SL1200_V1631683912_.jpg', 'The cuddle cup helps your furry friend feel safe during sleep time.', 'The water and dirt-resistant bottom keeps accidents away.', 'Easily toss the bed in the washer and dryer when your pal has had one too many messy moments.', 'You too will sleep soundly knowing this bed is made from safe, non-toxic materials.', 'Super soft plush will have your good boy happily napping in no time.'),
('Frisco Double-Sided Ceramic Elevated Cat Bowl', 'cat', 'other supplies', 11.58, NULL, 'Frisco', 241, 4.5, 'https://image.chewy.com/is/image/catalog/232081_MAIN._AC_SL1200_V1605055319_.jpg', 'https://image.chewy.com/is/image/catalog/232081_PT1._AC_SL1200_V1685731990_.jpg', 'https://image.chewy.com/is/image/catalog/232081_PT2._AC_SL1200_V1605110602_.jpg', 'https://image.chewy.com/is/image/catalog/232081_PT8._AC_SL1200_V1605756749_.jpg', 'Tiled ceramic bowl that complements any home décor look.', 'Elevated design helps with neck strain, swallowing and smoother digestion.', 'Each bowl on either side has a different angle to fit different pet size use.', 'Easy to flip the bowl and use either side.', 'BPA-Free.'),
