('Yaheetech Cat Scratching Tree', 'cat', 'other supplies', 59.99, NULL, 'Yaheetech', 211, 3.8, 'https://image.chewy.com/is/image/catalog/306487_MAIN._AC_SL1200_V1679607500_.jpg', 'https://image.chewy.com/is/image/catalog/306487_PT1._AC_SL1200_V1679603869_.jpg', 'https://image.chewy.com/is/image/catalog/306487_PT2._AC_SL1200_V1679603926_.jpg', 'https://image.chewy.com/is/image/catalog/306487_PT5._AC_SL1200_V1679603927_.jpg', 'Designed with a soft covering so that your kitties have a comfortable abode.', 'Includes a safety strap to help secure the cat tree to a wall, which helps prevent your cat from getting hurt when leaping off the tree.', 'This cat tree is designed for two to three cats weighing 10 pounds or less—it’s purr-fect for Siamese cats, Exotic shorthairs, Devon Rexes, Abyssinians and other small- and medium-sized breeds.', 'Features two enclosed condos with doors and windows so that your kitties can have a hiding spot.', 'Three perches allow your cat to look out, and three sisal rope coiled posts promote healthy scratching habits.'),
('Comfort Soft Mesh Cat Harness & Leash', 'cat', 'other supplies', 14.49, NULL, 'Comfort Soft', 135, 3.4, 'https://image.chewy.com/is/image/catalog/202031_MAIN._AC_SL1200_V1628191505_.jpg', 'https://image.chewy.com/is/image/catalog/202031_PT1._AC_SL1200_V1628195794_.jpg', 'https://image.chewy.com/is/image/catalog/202031_PT2._AC_SL1200_V1628231809_.jpg', 'https://image.chewy.com/is/image/catalog/202031_PT3._AC_SL1200_V1628193404_.jpg', 'All-in-one solution for safely walking your furbaby.', 'Lightweight, breathable mesh helps to keep your kitty cool and comfy.', 'Step-in design makes the harness su-purr easy to put on.', 'Secure, comfy fit with adjustable sizing.', 'Matching harness and leash deliver a cohesive look.'),
('Catit Jumbo Hooded Cat Pan', 'cat', 'other supplies', 53.99, NULL, 'Catit', 1870, 4.5, 'https://image.chewy.com/is/image/catalog/64829_MAIN._AC_SL1200_V1628020034_.jpg', 'https://image.chewy.com/is/image/catalog/64829_PT1._AC_SL1200_V1628019095_.jpg', 'https://image.chewy.com/is/image/catalog/64829_PT2._AC_SL1200_V1628018522_.jpg', 'https://image.chewy.com/is/image/catalog/64829_PT6._AC_SL1200_V1628020649_.jpg', 'Provides privacy while retaining the litter inside the pan.', 'Bag anchors keep bag and litter in place.', 'Includes disposable carbon filter to remove litter pan odor.', 'Ideal for large cats or for multi-cat households.', 'Removable clear plastic door allows easy access.');

